import React, { useState, useContext } from "react";
import { Link, NavLink } from "react-router-dom";
import "./index.css";
import { Container } from "react-bootstrap";
import "../../styles/components/NavBar/index.css";
import { AuthContext } from "../../shared/context/auth-context";

const BottomNav = (props) => {
  const auth = useContext(AuthContext);
  return (
    <Container className="bottom-nav">
      <NavLink className="explore">
        <i to={`/${auth.userId}`} class="fas fa-search">
          {" "}
          Explore
        </i>
      </NavLink>
      <NavLink to="/supply/new" className="add-product">
        <i class="fas fa-plus"> Add</i>
      </NavLink>
      <NavLink to="/auth" className="profile">
        <i class="fas fa-user"> Profile</i>
      </NavLink>
    </Container>
  );
};

export default BottomNav;
